function sizeof(g){var f=[g];var e=0;for(var d=0;d<f.length;d++){switch(typeof f[d]){case"boolean":e+=4;break;case"number":e+=8;break;case"string":e+=2*f[d].length;break;case"object":if(Object.prototype.toString.call(f[d])!="[object Array]"){for(var c in f[d]){e+=2*c.length}}for(var c in f[d]){var b=false;for(var a=0;a<f.length;a++){if(f[a]===f[d][c]){b=true;break}}if(!b){f.push(f[d][c])}}}}return e};
